DROP  TABLE IF EXISTS crm_customers;
CREATE TABLE  IF NOT EXISTS  crm_customers(
    id        int unsigned AUTO_INCREMENT PRIMARY KEY , -- 'id',
    name             varchar(24),                       -- '区号',
    source           varchar(24)        NOT NULL,                       -- 省份
	mobile           varchar(24)        NOT NULL,
	createtime       int  	unsigned 	NOT NULL,
    note             varchar(128)       NOT NULL,
    project_id       int  	unsigned 	NOT NULL,
    spread_type      int  	unsigned 	NOT NULL,
    data_type        int  	unsigned 	NOT NULL,
    truetime         int  	unsigned 	NOT NULL
)ENGINE=InnoDB DEFAULT CHARSET=utf8 ;

